import { h, Host } from "@stencil/core";
/**
 * @path /Table
 * @name Table Footer
 * @shortname Footer
 * @icon shoe-prints
 * @stable
 *
 *
 * The table footer. It holds `<dx-table-cell>` components similar to the `<dx-table-row>` component.
 * It is rendered below the table rows and is excluded from the sorting and paging of the table.
 */
export class DxTableFooter {
  render() {
    return (h(Host, { role: "rowgroup" }, h("div", { class: "footer-row", role: "row" }, h("slot", null))));
  }
  static get is() { return "dx-table-footer"; }
  static get encapsulation() { return "shadow"; }
  static get originalStyleUrls() {
    return {
      "$": ["dx-table-footer.scss"]
    };
  }
  static get styleUrls() {
    return {
      "$": ["dx-table-footer.css"]
    };
  }
}
